import React from 'react'
import EnterprizeCard from './cards/EnterprizeCard'
import FreeCard from './cards/FreeCard'
import ProCard from './cards/ProCard'

export default function PricingDetails() {
  const freeData = { 
    title: "Free", age: 34 }


  return (
    <section className=''>
      <div className='row'>
        <FreeCard data={freeData} />
        <ProCard />
        <EnterprizeCard />
      </div>
    </section>
  )
}
